import React, { useEffect, useState } from 'react';
import './App.css';
import MovieRow  from './Components/MovieRow/MovieRow';
import requests from './Constants/Requests';


function App() {

  return (
    <div className="App">
        <div style={{
          height: '100%',
          width: '100%',
          background: 'black',
        }}>
          <MovieRow backdrop fetchUrl={requests.fetchPopular.url} category="Trending"/>

          <div style={{
            marginTop: '77vh',
          }}>

          {
            Object.keys(requests).map((req, id) => {
              return (
                <div className={id === 0 ? "movie-row-1" : "movie-row"}>
                  <MovieRow key={id} fetchUrl={requests[req].url} category={requests[req].name}/>
                </div>
              )
            })
          }

          </div>


        </div>

    </div>
  );
}

export default App;
